Актриса певита телеведущая**Я вас любил: любовь еще, быть может, В душе моей угасла не совсем; 
Но пусть она вас больше не тревожит; 
Я не хочу печалить вас ничем. 
Я вас любил безмолвно, безнадежно, То робостью, то ревностью томим; 
вас любил так искренно, так нежно, Как дай вам бог любимой быть другим.
